import classes from './Filters.module.css';

const Filters = () => {
    return (
            <span className={classes.dropdown}>
                <button className={classes.dropbtn}>
                    <span>Filters</span>
                    <img src=''/>
                </button>
                Filters
            </span>
    );
}
 
export default Filters;
